,{"cell_type":"markdown","id":"e0577ea8","metadata":{"papermill":{"duration":0.216164,"end_time":"2022-03-04T11:17:00.110904","exception":false,"start_time":"2022-03-04T11:16:59.89474","status":"completed"},"tags":[]},"source":["**Ejemplo 2. Datos de Papel**  Queremos estudiar la relación existente entre la concentración de madera contenida en la pulpa a partir de la que se elabora papel (madera), y la resistencia (tension, en términos de tensión que soporta) del papel resultante. El objetivo del análisis es describir la tendencia observada. A continuación se presenta el banco de datos y se realiza la primera inspección gráfica."]},{"cell_type":"code","execution_count":3,"id":"6d27535d","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:00.555676Z","iopub.status.busy":"2022-03-04T11:17:00.553867Z","iopub.status.idle":"2022-03-04T11:17:00.754198Z","shell.execute_reply":"2022-03-04T11:17:00.752612Z"},"papermill":{"duration":0.425931,"end_time":"2022-03-04T11:17:00.754358","exception":false,"start_time":"2022-03-04T11:17:00.328427","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZxN9ePH8c85987c2TcaywxGtpA1spRkCSGihLElpG8JabGkhPxISZakLNmK\nli/pS1FEKISIoU2MrIOZMfudu5zz++P2Hb6DufeMmXvunHk9/+hxfc7Mnfd8OvfM+55zzzmS\nqqoCAAAAJZ+sdwAAAAAUDYodAACAQVDsAAAADIJiBwAAYBAUOwAAAIOg2AEAABgExQ4AAMAg\nKHYAAAAGYdY7QGE4HA673S6EsFgsslwau6mqqpIk6Z2iBMi7/jbT5ZZrrpgoTzBXnmNj5SE2\nVp7jBViwElnsjhw5sn79eiHEk08+WbFiRb3j6CAlJSUkJMRisegdxNdduXLF6XT6+fmFh4fr\nncXXWa1Wq9UaGRmpdxBfZ7PZ0tPThRDh4eF+fn56x/F1qampQUFBAQEBegfxdWlpaQ6Hw2w2\nR0RE6J3F1+Xm5mZnZ0dFRekdxEeVxt1dAAAAhkSxAwAAMAiKHQAAgEFQ7AAAAAyiRJ48kUdR\nFKfTqXcKfZTm391zrpOnVFVlrtxSFEUIwUS55ZoowWvQY0yUJ9hYeY6NlclkKmBpyS526enp\npfZkq6ysrKysLL1TlAwOhyM1NVXvFCUDE+W5jIwMvSOUDNnZ2dnZ2XqnKBmcTievQQ+V5okq\nU6ZMAVd7KdnFLjQ0tHSeGZ6WlhYYGOjv7693EF+Xnp6uKIrZbA4JCdE7i6/Lzc3Nzc0NCwvT\nO4ivs9vtrvdUISEhZnPJ3oR6gevtNxsrtzIyMpxOp8lkCg0N1TuLr7PZbFart