EwQ4AAEAlCHYAAAAqQbADAABQCYIdAACAShDsAAAAVOIPrBOlGDEPNcUAAAAA\nSUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Residuos y medidas de diagnóstico\n","diagnostico <- fortify(fit)\n","# Gráfico de residuos estandarizados vs ajustados\n","ggplot(diagnostico, aes(x = .fitted, y = .stdresid)) + \n","  geom_point() + \n","  stat_smooth(method = \"lm\", se = FALSE) "]},{"cell_type":"markdown","id":"fb16b903","metadata":{"papermill":{"duration":0.242574,"end_time":"2022-03-04T11:17:18.44428","exception":false,"start_time":"2022-03-04T11:17:18.201706","status":"completed"},"tags":[]},"source":["Se puede concluir que se verifica la hipótesis de linealidad (recta horizontal), ya que no existen tendencias en los residuos. Además con los residuos se comportan de forma aleatoria sin agrupaciones ni tendencias podemos concluir que se cumple la hipótesis de homogeneidad de varianzas. Hay que tener mucho cuidad con la interpretación de estos gráficos, ya que cuando el tamaño de muestra es pequeño, resulta difícil apreciar tenencias o agrupaciones en los residuos. Por este motivo realizamos el test de diagnóstico."]},{"cell_type":"code","execution_count":16,"id":"b4e9110f","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:18.935147Z","iopub.status.busy":"2022-03-04T11:17:18.933035Z","iopub.status.idle":"2022-03-04T11:17:18.955487Z","shell.execute_reply":"2022-03-04T11:17:18.953727Z"},"papermill":{"duration":0.26878,"end_time":"2022-03-04T11:17:18.955671","exception":false,"start_time":"2022-03-04T11:17:18.686891","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tstudentized Breusch-Pagan test\n","\n","data:  fit\n","BP = 0.024539, df = 1, p-value = 0.8755\n"]},"metadata":{},"output_type":"display_data"}],"source":["# Test de diagnóstico\n","bptest(fit)"]},{"cell_type":"markdown","id":"07b905fa","metadata":{"papermill":{"duration":0.242909,"end_time":"2022-03-04T11:17:19.447162","exception":false,"start_time":"2022-03-04T11:17:19.204253","status":"completed"},"tags":[]},"source":["Dado que el p-valor del contraste es superior a 0.05 no podemos rechazar la hipótesis nula, y por tanto podemos concluir que se verifica la hipótesis de homogeneidad o varianza constante."]},{"cell_type":"markdown","id":"7608b20f","metadata":{"papermill":{"duration":0.245631,"end_time":"2022-03-04T11:17:19.940565","exception":false,"start_time":"2022-03-04T11:17:19.694934","status":"completed"},"tags":[]},"source":["***Verifica la hipótesis de homogeneidad de varainzas para los modelos de datos de papel y viscosidad.***"]},{"cell_type":"code","execution_count":17,"id":"97a3d421","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:20.437337Z","iopub.status.busy":"2022-03-04T11:17:20.435531Z","iopub.status.idle":"2022-03-04T11:17:20.449206Z","shell.execute_reply":"2022-03-04T11:17:20.44731Z"},"papermill":{"duration":0.263952,"end_time":"2022-03-04T11:17:20.449399","exception":false,"start_time":"2022-03-04T11:17:20.185447","status":"completed"},"tags":[]},"outputs":[],"source":["# Datos de papel"]},{"cell_type":"code","execution_count":18,"id":"a443164a","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:20.958703Z","iopub.status.busy":"2022-03-04T11:17:20.956954Z","iopub.status.idle":"2022-03-04T11:17:20.969839Z","shell.execute_reply":"2022-03-04T11:17:20.968111Z"},"papermill":{"duration":0.27096,"end_time":"2022-03-04T11:17:20.969984","exception":false,"start_time":"2022-03-04T11:17:20.699024","status":"completed"},"tags":[]},"outputs":[],"source":["# Datos de viscosidad"]},{"cell_type":"markdown","id":"e513675d","metadata":{"papermill":{"duration":0.275065,"end_time":"2022-03-04T11:17:21.49901","exception":false,"start_time":"2022-03-04T11:17:21.223945","status":"completed"},"tags":[]},"source":["### Normalidad\n","\n","Para verificar la normalidad de los errores, disponemos de gráficos qq-plot de normalidad, en los que se representan los residuos ordenados $r_{[i]}$ (cuantiles empíricos) versus los cuantiles correspondientes a una normal estándar, $\\Phi^{-1}[(i-1)/n]$. Si es cierta la normalidad de los residuos, los puntos han de estar alineados con la diagonal. Desviaciones de la diagonal más o menos severas en las colas, e incluso en el centro de la distribución, dan indicios de desviaciones de normalidad. \n","La hipótesis de normalidad se puede chequear también con histogramas de los residuos cuando el tamaño muestral es grande.\n","\n","Los residuos estandarizados también son útiles para detectar desviaciones de la normalidad. Si los errores se distribuyen según una normal, entonces aproximadamente el $68\\%$ de los residuos estandarizados quedarán entre $-1$ y $+1$, y el $95\\%$ entre $-2$ y $+2$.\n","\n","Para diagnosticar la hipótesis de normalidad se utiliza el test de Shapiro-Wilks, donde rechazar la hipótesis nula implica el rechazo de la hipótesis de normalidad. Para realizar dicho contraste utilizamos la función `shapiro.test()`."]},{"cell_type":"code","execution_count":19,"id":"6b4ae9f3","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:22.035489Z","iopub.status.busy":"2022-03-04T11:17:22.033866Z","iopub.status.idle":"2022-03-04T11:17:22.270172Z","shell.execute_reply":"2022-03-04T11:17:22.269194Z"},"papermill":{"duration":0.493907,"end_time":"2022-03-04T11:17:22.270321","exception":false,"start_time":"2022-03-04T11:17:21.776414","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3yT9eK/8e+dpIMWyt5bpsgSUUERVEgHpdCWVaYgIIIgoMhSfiCylY0gArKx\n7Ba60iCiHMCjIiCCzANSNpSW0p3kvv8Pev7oUaAFmn6T9Ho/8BXTkvsypu2HNEPRNE0AAADA\n+elkBwAAACB/MOwAAABcBMMOAADARTDsAAAAXATDDgAAwEUw7AAAAFwEww4AAMBFMOwAAABc\nhEF2QC5SUlL69Okju8IhqKqqKIqiKLJDHJ2maTkvu63T8feW3KmqyhWVF6qqCiH4GsyLnK9B\nbld5we0q7/gh+Fcvv/zymDFj7vshRx92NpvNYrE0btxYdoh8FotFp9Pp9XrZIY7OZrNZrVZF\nUdzd3WW3OIGsrCx3d3e+V+bKYrGoqqrX6w0GR/+2KZ2