7k5O+J7xRFR+DV7n6kzRN+7R2CZ+gZ//5BUeinxaR+Et/vSlJysHEwe2fLhsU\nYPIrXrths4mLE3Ltf3/xqW8+iTA/WiLQ18unSLVGz0yK2n7tpKU1i193zrc+t+vC/n67k7yq\nhIVtn6wb6Gf09i/WqEW3lTtO5x2ffnxb31aPVSjhH1j2/uZhvbbsv3R+94wqxfxMAaX+zLby\ndicA7ohOu53HMwAAAOD0eI4dAACAm2DYAQAAuAmGHQAAgJtg2AEAALgJhh0AAICbYNgBAAC4\nCYYdAACAm2DYAQAAuAmGHQAAgJtg2AEAALgJhh0AAICbYNgBAAC4CYYdAACAm/g/WV7oi7wo\n530AAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# grafico qq\n","ggplot(diagnostico, aes(sample = .stdresid)) + \n","  stat_qq() + \n","  geom_abline() +\n","  theme_bw()"]},{"cell_type":"markdown","id":"ef7fdac4","metadata":{"papermill":{"duration":0.255565,"end_time":"2022-03-04T11:17:22.78621","exception":false,"start_time":"2022-03-04T11:17:22.530645","status":"completed"},"tags":[]},"source":["El gráfico de normalidad muestra un comportamiento correcto ya que los punto se distribuyen a lo largo de la recta de normalidad. No se realiza el histograma ya que el tamaño muestral es demasiado pequeño. Pasamos al test de diagnóstico."]},{"cell_type":"code","execution_count":20,"id":"cf885bc7","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:23.304179Z","iopub.status.busy":"2022-03-04T11:17:23.302055Z","iopub.status.idle":"2022-03-04T11:17:23.3216Z","shell.execute_reply":"2022-03-04T11:17:23.320037Z"},"papermill":{"duration":0.274861,"end_time":"2022-03-04T11:17:23.321763","exception":false,"start_time":"2022-03-04T11:17:23.046902","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tShapiro-Wilk normality test\n","\n","data:  diagnostico$.stdresid\n","W = 0.92905, p-value = 0.3312\n"]},"metadata":{},"output_type":"display_data"}],"source":["# Test de diagnóstico\n","shapiro.test(diagnostico$.stdresid)"]},{"cell_type":"markdown","id":"7f45e4b4","metadata":{"papermill":{"duration":0.255536,"end_time":"2022-03-04T11:17:23.824509","exception":false,"start_time":"2022-03-04T11:17:23.568973","status":"completed"},"tags":[]},"source":["Dado que el p-valor del contraste es superior a 0.05 no podemos rechazar la hipótesis nula, y por tanto podemos considerar que los residuos se distribuyen normalmente."]},{"cell_type":"markdown","id":"7a895fd1","metadata":{"papermill":{"duration":0.256247,"end_time":"2022-03-04T11:17:24.335908","exception":false,"start_time":"2022-03-04T11:17:24.079661","status":"completed"},"tags":[]},"source":["***Analiza la hipótesis de normalidad para los modelos de los datos de papel y viscosidad***"]},{"cell_type":"markdown","id":"fa9489ae","metadata":{"papermill":{"duration":0.250523,"end_time":"2022-03-04T11:17:24.839849","exception":false,"start_time":"2022-03-04T11:17:24.589326","status":"completed"},"tags":[]},"source":["### Independencia. \n","\n","La correlación entre los datos es un proceso intrínseco al muestreo; saber cómo se ha llevado a cabo éste da información, generalmente suficiente, para poder hablar de correlación o incorrelación. En todo caso, los gráficos secuenciales de residuos sirven para detectar problemas de correlación de éstos (*autocorrelación*), o de inestabilidad de la varianza a lo largo del tiempo. También son útiles para esto los gráficos en que se representa un residuo versus el anterior en la secuencia en que han sido observados; si hay correlación se apreciará tendencia. Detectar autocorrelación llevará a considerar otro tipo de modelos distintos (autocorrelados: modelos de series temporales). \n","\n","Aparte de los métodos gráficos, para resolver dicho contraste se utiliza el test de Durbin-Watson, cuya función es `dwtest()`. Rechazar la hipótesis nula implica el rechazo de la hipótesis de incorrelación."]},{"cell_type":"code","execution_count":21,"id":"adfb08f8","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:25.354273Z","iopub.status.busy":"2022-03-04T11:17:25.352498Z","iopub.status.idle":"2022-03-04T11:17:25.439854Z","shell.execute_reply":"2022-03-04T11:17:25.438336Z"},"papermill":{"duration":0.345198,