nd_time":"2022-03-04T11:17:55.724624","exception":false,"start_time":"2022-03-04T11:17:55.420771","status":"completed"},"tags":[]},"source":["# Ejercicios\n","\n","**Ejercicio 1.** En 1929 Edwin Hubble investigaba la relación entre la distancia (en megaparsecs. 1 parsec=3.26 años luz) de una galaxia a la tierra y la velocidad (en Km/sg) con la cual parece retroceder. Observo que las galaxias parecen alejarse de nosotros no importa cual sea la dirección en que miremos. Se piensa de hecho que esto es el resultado del ”Big Bang”. Hubble esperaba aportar conocimiento sobre la formación del universo y sobre cual podría ser su evolución en el futuro. Los datos que recogió incluyen las distancias de la tierra a 24 galaxias, así como sus correspondientes velocidades de retroceso. El objetivo principal del estudio que Hubble llevo a cabo era determinar la edad del universo, y para ello establece lo que se conoce hasta ahora como la ley de Hubble: \n","\n","$$V = H_0*D$$\n","\n","Los datos recogidos fueron:"]},{"cell_type":"code","execution_count":42,"id":"e3fcecfe","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:56.324391Z","iopub.status.busy":"2022-03-04T11:17:56.322982Z","iopub.status.idle":"2022-03-04T11:17:56.340302Z","shell.execute_reply":"2022-03-04T11:17:56.338513Z"},"papermill":{"duration":0.319508,"end_time":"2022-03-04T11:17:56.340491","exception":false,"start_time":"2022-03-04T11:17:56.020983","status":"completed"},"tags":[]},"outputs":[],"source":["distancia <- c(.032, .034, .214, .263, .275, .275, .45, .5, .5, .63, .8, .9, .9, \n","        .9, .9, 1.0, 1.1, 1.1, 1.4, 1.7, 2.0, 2.0, 2.0, 2.0)\n","velocidad <- c(170, 290, -130, -70, -185, -220, 200, 290, 270, 200, 300, -30, 650, \n","        150, 500, 920, 450, 500, 500, 960, 500, 850, 800, 1090) \n","ejer01 <- data.frame(distancia, velocidad)"]},{"cell_type":"code","execution_count":43,"id":"3a5a932e","metadata":{"execution":{"iopub.execute_input":"2022-03-04T11:17:56.962804Z","iopub.status.busy"